function App() {
  return (
    <div>
        <Router>
              {/* <HeaderComponent /> */}
                <div className="container">
                    <Switch> 
                          <Route path = "/" exact component = {ListVehicleComponent}></Route>
                          <Route path = "/api/vehicles" component = {ListVehicleComponent}></Route>
                    </Switch>
                </div>
        </Router>
    </div>
  );
}

  export default App;
